=head1 B<CamGetRecordTypes()>

=over 6

=item Package:

 GSX::CamRecordTable

=item Arguments:

 Nothing

=item Output:

 array of known record types

=back

=cut

sub CamGetRecordTypes {                  
  return ( sort keys %recordTable );     
}                                        

=head1 B<CamIsRecordDefined()>

=over 6

=item Package:

 GSX::CamRecordTable

=item Arguments:

 Record type

=item Output:

 1 if defined, 0 if undefined

=back

=cut

sub CamIsRecordDefined {                 
  if( $recordTable{$_[0]} ) {            
	return ( 1 );                        
  }                                      
  return ( 0 );                          
}                                        

=head1 B<CamGetFieldName()>

=over 6

=item Package:

 GSX::CamRecordTable

=item Arguments:

 Record type
 Field number

=item Output:

 String describing the fields

=back

=cut

sub CamGetFieldName {                    
  return ( $recordTable{$_[0]}[$_[1]] ); 
}                                        


